import React from "react";
import { Drawer, InputNumber, Select, Button, Form, Row, Col } from "antd";
const { Option } = Select;
const Drawers = ({
  visible,
  onClose,
  number,
  seats,
  numberhandleChange,
  handleAdd,
  typehandleChange,
  seatsHandleChange
}) => {
  return (
    <Drawer
      width={420}
      title="AddItem"
      closable={false}
      placement="right"
      onClose={onClose}
      visible={visible}
    >
      <Form>
        <Form.Item>
          <InputNumber
            placeholder="Table Number"
            value={number}
            onChange={numberhandleChange}
            style={{ width: "380px" }}
          />
        </Form.Item>
        <Form.Item>
          <Select onChange={typehandleChange} defaultValue="select Type">
            <Option value="round">Round</Option>
            <Option value="square">Square</Option>
          </Select>
        </Form.Item>

        <Form.Item>
          <InputNumber
            placeholder="seats"
            value={seats}
            onChange={seatsHandleChange}
            style={{ width: "380px" }}
          />
        </Form.Item>
        <Row>
          <Col span={8}>
            <Form.Item>
              <Button onClick={handleAdd} type="primary">
                Add
              </Button>
            </Form.Item>
          </Col>
          <Col span={8}>
            <Form.Item>
              <Button onClick={onClose} type="danger">
                Cancel
              </Button>
            </Form.Item>
          </Col>
        </Row>
      </Form>
    </Drawer>
  );
};

export default Drawers;
